  false,\n\t\"url\": null,\n\t\"notes\": \"The bid tabulations provided herein are
  preliminary and are for informational purposes only. The purpose of providing this
  preliminary information is to improve process transparency. The information contained
  in the preliminary bid tabulations is subject to change pending math review, analysis
  of all bids, and review of documentation provided.rnBids: All bids estimated at
  $25,000 or more are publicly opened and read at the time, date, and place specified
  in the bid document.rnRFP/RFQ/RFI: Responses to RFP/RFQ/RFI are not publicly opened.
  Names of respondents will be made available based on the names identified on the
  sealed package and is, therefore, subject to change.rnrnFor bid tabulations before
